import React, { Component } from 'react';
import axios from 'axios';
import { 
  Box, 
  Tabs, 
  Tab, 
  Button, 
  Typography,
  TextField,
  AppBar
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import './App.css';

class ModelTab extends Component {
  constructor(props) {
    super(props);
    this.state = {
      modelData: null,
      error: null,
      loading: false,
      selectedDataset: "",
      selectedModel: "",
      isTraining: false,
      inputText: "",
      modelExists: false  // New state to track if model exists
    };
  }

  componentDidMount() {
    this.fetchModelData();
  }

  fetchModelData = async () => {
    try {
      this.setState({ loading: true });
      const response = await axios.get(`http://127.0.0.1:5050/process-model/?model_id=${this.props.modelId}`);

      // Check if model exists and update state accordingly
      const modelExists = response.data !== null;
      this.setState({ 
        modelData: response.data,
        loading: false,
        modelExists,
        // If model exists, set the selected options from the model data
        ...(modelExists && response.data && {
          selectedDataset: response.data.concept_dataset || "",
          selectedModel: response.data.backbone || ""
        })
      });
    } catch (error) {
      this.setState({ 
        error: 'Error fetching data from server',
        loading: false,
        modelExists: false
      });
      console.error('Error:', error);
    }
  };

  handleTrainClick = async () => {
    const { selectedDataset, selectedModel } = this.state;
    this.setState({ isTraining: true });

    try {
      const response = await axios.post('http://127.0.0.1:5050/process-model/', {
        concept_dataset: selectedDataset,
        model_type: "LLM",
        backbone: selectedModel,
        model_id: this.props.modelId,
        hardware: "Local Hardware"
      });

      alert("Training completed: " + response.data.message);
      this.fetchModelData(); // Refresh model data after training
    } catch (error) {
      console.error("Train Error:", error);
      alert("Training failed. Check the backend logs.");
    } finally {
      this.setState({ isTraining: false });
    }
  };

  render() {
    const { 
      modelData, 
      error, 
      loading, 
      selectedDataset, 
      selectedModel, 
      isTraining,
      modelExists 
    } = this.state;

    // Style for disabled buttons
    const disabledButtonStyle = {
      backgroundColor: '#grey',
      color: 'darkgrey',
      '&:hover': {
        backgroundColor: '#grey',
      }
    };

    return (
      <Box sx={{ p: 3 }}>
        <Typography variant="h6">Model ID: {this.props.modelId}</Typography>

        {loading && <Typography>Loading...</Typography>}
        {error && <Typography color="error">{error}</Typography>}

        <Box sx={{ mt: 3 }}>
          <Typography variant="subtitle1">
            Select Dataset:
            {modelExists && <span style={{ color: 'green' }}> (Model Trained)</span>}
          </Typography>
          <Box sx={{ display: 'flex', gap: 1, my: 1 }}>
            {["SST2", "yelp_polarity", "ag_news", "dbpedia_14"].map((dataset) => (
              <Button
                key={dataset}
                variant={selectedDataset === dataset ? "contained" : "outlined"}
                onClick={() => !modelExists && this.setState({ selectedDataset: dataset })}
                disabled={modelExists}
                sx={modelExists ? disabledButtonStyle : {}}
              >
                {dataset}
              </Button>
            ))}
          </Box>

          <Typography variant="subtitle1" sx={{ mt: 2 }}>Select Model:</Typography>
          <Box sx={{ display: 'flex', gap: 1, my: 1 }}>
            {["gpt2", "roberta"].map((model) => (
              <Button
                key={model}
                variant={selectedModel === model ? "contained" : "outlined"}
                onClick={() => !modelExists && this.setState({ selectedModel: model })}
                disabled={modelExists}
                sx={modelExists ? disabledButtonStyle : {}}
              >
                {model}
              </Button>
            ))}
          </Box>

          <Button
            variant="contained"
            color="primary"
            onClick={this.handleTrainClick}
            disabled={modelExists || !selectedDataset || !selectedModel || isTraining}
            sx={{ 
              mt: 2,
              ...(modelExists && disabledButtonStyle)
            }}
          >
            {isTraining ? "Training..." : modelExists ? "Model Trained" : "Train Model"}
          </Button>
        </Box>

        {modelData && (
          <Box sx={{ mt: 3 }}>
            <Typography variant="h6">Model Data:</Typography>
            <pre>{JSON.stringify(modelData, null, 2)}</pre>
          </Box>
        )}
      </Box>
    );
  }
}

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      tabs: [1], // Start with one tab using model_id 1
      activeTab: 0
    };
  }

  handleTabChange = (event, newValue) => {
    this.setState({ activeTab: newValue });
  };

  addNewTab = () => {
    this.setState(prevState => ({
      tabs: [...prevState.tabs, Math.max(...prevState.tabs) + 1],
      activeTab: prevState.tabs.length
    }));
  };

  render() {
    const { tabs, activeTab } = this.state;

    return (
      <Box sx={{ width: '100%' }}>
        <AppBar position="static" color="default">
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <Tabs 
              value={activeTab}
              onChange={this.handleTabChange}
              variant="scrollable"
              scrollButtons="auto"
            >
              {tabs.map((modelId, index) => (
                <Tab key={modelId} label={`Model ${modelId}`} />
              ))}
            </Tabs>
            <Button 
              onClick={this.addNewTab}
              startIcon={<AddIcon />}
              sx={{ minWidth: 'auto', mx: 1 }}
            >
              New Model
            </Button>
          </Box>
        </AppBar>

        {tabs.map((modelId, index) => (
          <Box
            key={modelId}
            role="tabpanel"
            hidden={activeTab !== index}
          >
            {activeTab === index && (
              <ModelTab modelId={modelId} />
            )}
          </Box>
        ))}
      </Box>
    );
  }
}

export default App;
